// Initialize Tracker Objects
var pageTracker, taggedTracker, masterTracker = new ROITracker("", "t1");

ROITracker.crmTrackingHandler = function() {
    _gaq.push(function () {
        if (typeof taggedTracker === 'undefined') { return; }
        var containerElement = document.getElementById("signup_form") || document.getElementById("mobile-signup") || 'not found';

        if (containerElement !== 'not found') {
            try {
                containerElement.getElementsByTagName("form")[0].id = "ga_signup";
            } catch(e) {}
        }

        taggedTracker.crmTracking(["ga_signup", "form-iphone-signup"]);
    });
};

if (/\.getharvest\.com/.test(location.hostname)) {
    pageTracker = masterTracker.createTracker("UA-103886-3", "");
    taggedTracker = pageTracker.createTracker("UA-103886-20", "t2");
    taggedTracker.setAttributionModel(true, true, "fcpc", "gclid=|utm_source=", "utmgclid=|utmccn=(?:[^(]|[(][^)|]*[)][^|])");

    ROITracker.crmTrackingHandler();
    ROITracker.trackAdWordsRemarketing("1065883916", "vMCPCOTh6QQQjLKg_AM");
} else { // harvestapp
    pageTracker = masterTracker.createTracker("UA-103886-9", "");
}

masterTracker.setDomainNames([".getharvest.com", ".harvestapp.com"], true);

pageTracker._trackPageview();
pageTracker._trackPageLoadTime();

ROITracker.processQueuedCommands();
